import React from "react";
import './result.css';

function resultPage(){
    return (
     <div class="Result">
        <div className="upperTitle">
            <p>MBTI</p>
        </div>

        <div className="userMbti">

        </div>

        {/*서버에서 mbti 정보 가져올 부분*/}
        <div className="detailMbti">

        </div>

        <div className="btns">
            <button>홈</button>
            <button>관리자 페이지</button>
        </div>

        <div className="lowerTitle"></div>

     </div>
    );
}
export default resultPage;
